import Expenses from "./components/Expenses.js";

function App() {
  const data = [
    { title: "Product 1", price: 10, description: "First Product", date: "20 APR", category: "Food" },
    { title: "Product 2", price: 20, description: "Second Product", date: "18 FEB", category: "Shopping" },
    { title: "Product 3", price: 45, description: "Third Product", date: "12 JUN", category: "Entertainment" },
  ];

  return (
    <div>
      <Expenses data={data}></Expenses>
    </div>
  );
}

export default App;
